import React, {Component} from 'react';
import './style.scss';
import { db } from '../firebaseConfig';
import logo from '../images/logo.svg';
import star from '../images/star.svg';
import monica from '../images/monica.jpeg';
import ridhi from '../images/ridhi.jpg';
import arun from '../images/arun.jpg';
import pankaj from '../images/pankaj.jpeg';
import uday from '../images/uday.jpg';
import ram from '../images/ram.jpeg';

class Home extends Component {
    componentDidMount() {
        const TeamData = db.collection('team').doc('info').collection('tnc').doc('en');
          TeamData.get().then((doc) => {
            if (doc.exists) {
              this.setState({ tncData: doc.data().data });
            } else {
              console.log("No such document!");
            }
          }).catch((error) => {
            console.log("Error getting document:", error);
          });

          // Add a new document in collection "cities"
              db.collection('team').doc('info').set({
            "data": [
              {
                "name": "monica",
                "desc": "",
                "img": ""
              },
              {
                "name": "ridhi",
                "desc": "",
                "img": ""
              },
              {
                "name": "arun",
                "desc": "",
                "img": ""
              },
              {
                "name": "uday",
                "desc": "",
                "img": ""
              },
              {
                "name": "pankaj",
                "desc": "",
                "img": ""
              },
              {
                "name": "ram",
                "desc": "",
                "img": ""
              },
              {
                "name": "abhishek",
                "desc": "",
                "img": ""
              }
            ]
          })
          .then(function() {
            console.log("Document successfully written!");
          })
          .catch(function(error) {
            console.error("Error writing document: ", error);
          });
      }
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-lg-12 my-5"><h1>FE Team Members</h1></div>
                </div>
                <div className="row">
                    <div className="col-xs-12 col-sm-6 col-lg-4">
                        <figure className="effect-bubba">
                            <img src={monica} className="img-thumbnail img-fluid rounded" />
                            <figcaption className="hidden-sm hidden-xs">
                                <p>Resourceful</p>
                                <h2>Monica</h2>
                            </figcaption>
                        </figure>
                    </div>
                    <div className="col-xs-12 col-sm-6 col-lg-4">
                        <figure className="effect-bubba">
                            <img src={ridhi} className="img-thumbnail img-fluid rounded" />
                            <figcaption className="hidden-sm hidden-xs">
                                <p>Dedicated</p>
                                <h2>Ridhi</h2>
                            </figcaption>
                        </figure>
                    </div>
                    <div className="col-xs-12 col-sm-6 col-lg-4">
                        <figure className="effect-bubba">
                            <img src={arun} className="img-thumbnail img-fluid rounded" />
                            <figcaption className="hidden-sm hidden-xs">
                                <p>Skilful</p>
                                <h2>Arun</h2>
                            </figcaption>
                        </figure>
                    </div>
                    <div className="col-xs-12 col-sm-6 col-lg-4">
                        <figure className="effect-bubba">
                            <img src={uday} className="img-thumbnail img-fluid rounded" />
                            <figcaption className="hidden-sm hidden-xs">
                                <p>Analytical</p>
                                <h2>Uday</h2>
                            </figcaption>
                        </figure>
                    </div>
                    <div className="col-xs-12 col-sm-6 col-lg-4">
                        <figure className="effect-bubba">
                            <img src={pankaj} className="img-thumbnail img-fluid rounded" />
                            <figcaption className="hidden-sm hidden-xs">
                                <p>Disciplined</p>
                                <h2>Pankaj</h2>
                            </figcaption>
                        </figure>
                    </div>
                    <div className="col-xs-12 col-sm-6 col-lg-4">
                        <figure className="effect-bubba">
                            <img src={ram} className="img-thumbnail img-fluid rounded" />
                            <figcaption className="hidden-sm hidden-xs">
                                <p>Hardworking</p>
                                <h2>Ram</h2>
                            </figcaption>
                        </figure>
                    </div>
                </div>
            </div>
        );
    }
  }
  export default Home;
